import axios from 'axios'

export const resetUser = async (data) => {
    const updatedUser = await axios.post(`${process.env.REACT_APP_ENDPOINT}/API/updateUser`, {data})
    const updatedUserFiatNumber: Number = updatedUser.data
    return updatedUserFiatNumber
}
